import {localUrl, wsUrl} from "../../config";

export default {
    server: {
        webSocketServer: {
            host: `${localUrl}`,
            port: 8081,
            path: `${localUrl}`
        },
        peerServer: {
            host: `${wsUrl}`,
            port: 9000,
            path: "/"
        }
    }
};
